import React from 'react';

import './App.css';

import { BrowserRouter, Routes, Route, Outlet} from 'react-router-dom'

import {Home} from './pages/index'

function App() {

  const Layout = () => {
    return (
      <>
        <Header  />
        <Outlet />
        <Footer />
      </>
    )
  }


  return (
    <>
      <BrowserRouter>
        <Routes> 
          <Route path="/" element={<Layout />}>
            <Route path="/" element={<Home /> } />
          </Route>
        </Routes>
      </BrowserRouter>
    </>
  );
}

export default App;
